INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3038359005794', 'Riz long grain', '1) PRÉPARATION DU RIZ Cuire le riz dans un grand volume d\'eau bouillante salée, comme indiqué sur le paquet, puis l\'égoutter et le conserver au chaud. Avec un zesteur, prélever des filaments de carottes épluchées, de betterave épluchée et de branche de céleri. Mettre la moitié du beurre dans une sauteuse et ajouter les filaments de carottes et de céleri. Faire revenir quelques minutes. Mélanger le riz chaud avec les filaments crus de betteraves, de carottes et de céleri et dresser le tout dans les assiettes avec un cercle en Inox.', 'https://static.openfoodfacts.org/images/products/303/835/900/5794/front_fr.4.400.jpg', '1.2', '0.3', '81', '0.5', '1.7', '7', '0.02', '0.0078740157480315', '', '1');

